Quick howto:

*install I2P (http://www.i2p2.de/)
*open the ports in your router (udp/tcp) until Network is 'OK'
*adjust bandwidth settings
*configure proxy 127.0.0.1:4444 in your browser
*after I2P is 2min running open in browser: http://tracker2.postman.i2p/index.php?view=TPoolDetail&amp;id=524
*choose what you need, copy 'Magnet Link'
*open included BT-Client, paste 'Magnet Link'
*press start and be patient
*check C:Users&lt;account&gt;AppDataRoamingI2Pi2psnark for incoming data


-Enjoy
